import axios from "axios";

export const getAllNavigate = async () => {
  try {
    const response = await axios.get("http://localhost:3000/navigation");
    return response.data;
  } catch (error) {
    console.error(error);
    return [];
  }
};

export const getAllProducts = async (code) => {
  const params = {
    category: code,
  };
  try {
    const response = await axios.get("http://localhost:3000/products", {
      params: params,
    });
    return response.data;
  } catch (error) {
    console.error(error);
    return [];
  }
};
